import React from "react";

const Footer: React.FC = () => {
  return (
    <footer
      style={{
        marginTop: "40px",
        padding: "15px",
        background: "#030303ff",
        textAlign: "center",
      }}
    >
      <p
        style={{
          fontFamily: "Arial, Helvetica, sans-serif", // ✅ Change font
          fontSize: "16px", // ✅ Change size
          color: "#eb6f0bff", // ✅ Change text color (gold)
          fontWeight: "bold", // ✅ Make it bold
          letterSpacing: "1px", // ✅ Space between letters
        }}
      >
        © 2025 My React + TypeScript Website
      </p>
    </footer>
  );
};

export default Footer;
